    segments = sorted(segments, key=lambda x: x[1])

    for i in range(n):
        if segments[i][0] > segments[i+1][0]:
            segments[i] = (segments[i][0], segments[i+1][1])
            segments[i+1] = (segments[i+1][0], segments[i][1])

    def length(segment):
        return segment[1] - segment[0]

    segments = sorted(segments, key=length)

    min_length = float('inf')
    remove_segment_index = None
    for i in range(n):
        if length(segments[i]) < min_length:
            min_length = length(segments[i])
            remove_segment_index = i

    if min_length == float('inf'):
        return 0

    segments.pop(remove_segment_index)
    segments.sort(key=length)

    for i in range(n):
        if length(segments[i]) == min_length:
            return min_length

