    w, h = map(int, stdin.split())

    grid = []
    traps = set()

    for _ in range(h):
        row = stdin.split()[h*i:h*(i+1)]
        if 'P' in row:
            x, y = row.index('P'), h - 1
        else:
            x, y = 0, h - 1
        grid.append(row)

    for x in range(w):
        for y in range(h - 1, -1, -1):
            if grid[y][x] == '#':
                traps.add((x, y))

    for x in range(w):
        for y in range(h - 1, 0, -1):
            if grid[y][x] == '.':
                if (x, y) in traps:
                    return '0'

    # O(n^2)
    def get_distance(x0, y0, x1, y1):
        if x1 < x0 or y1 < y0:
            return float('inf')
        elif (x0, y0) == (x1, y1):
            return 0
        return min(get_distance(x0, y0, x2, y2) + 1 for x2, y2 in [(x0 - 1, y0), (x0, y0 - 1), (x0 + 1, y0), (x0, y0 + 1)])

    return str(sum(1 for x, y in traps if get_distance(x, y, x + 1, y) <= 2))

