    for _ in range(k):
        visited |= {(x, y) for x, y in visited if mat[x][y] == _ + 1}
        next_tiles = set()
        for x, y in visited:
            for dx, dy in ((-1, 0), (1, 0), (0, -1), (0, 1)):
                x_new, y_new = x + dx, y + dy
                if 0 <= x_new < n and 0 <= y_new < n:
                    next_tiles.add((x_new, y_new))
        visited |= next_tiles
    return len(visited) - 1

