    for x in range(size):
        for y in range(size):
            for z in range(size):
                # If the block has a hole, we are going to ignore it
                if (x, y, z) in holes:
                    continue
                # Find the size of the slice
                size_of_block = 2 * x + 2 * y + 2 * z
                # If the slice is bigger than the maximum size of the block, we are going to ignore it
                if size_of_block > size:
                    continue
                # Add the slice to the grid
                grid[(x, y, z)].append(size_of_block)

    # Make sure to sort the grid in descending order
    grid = {k: sorted(v, reverse=True) for k, v in grid.items()}

    # The list of solutions
    solutions = []
