    result = []

    # Perform the BFS traversal
    def bfs(start_cell):
        visited = set()
        queue = [start_cell]
        while queue:
            curr = queue.pop(0)
            if curr in visited:
                continue
            visited.add(curr)
            for nbr in grid.get(curr, []):
                if nbr not in visited:
                    queue.append(nbr)
        return visited

    # Get all possible places
    places = bfs(0)
    for place in places:
        if place in grid:
            continue
        result.append("." * place + "#" * (len(grid) - place) + "." * (m - place - 1))

    # Return the result
    return "\n".join(result)

